export const SignUp = () => {
    return (
        <div className="container">
            <h1>Вход</h1>
            <form method="post">
                <input placeholder="Почта" required />
                <input placeholder="Пароль" required />
                <button type="submit">Вход</button>
            </form>
        </div>
    )
}
